import React from 'react';
import {MainMenuPhotos} from "../../ImageCarouselPaths"

class PhotosView extends React.Component {

    render(props){  
        return(
            <>
                  {MainMenuPhotos.map(item => (

                    <img src={item.image} />
                    ))}
            </>
        )
    }
};

export default PhotosView;
